import React from "react";

function Nav() {
  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-light" >
      <span class="footer-copyright text-center py-3">Recipe Reading App</span>
      <a className="navbar-brand" href="/" >
      </a>
    </nav>
  );
}

export default Nav;
